import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import './App.css';
import FrontPage from './pages/FrontPage.js'
function App() {
  return (
    <div class="bg-red-500">
    <Router>
      <Route path="/" exact component={FrontPage}/>
    </Router>
    </div>
  );
}

export default App;
